import { Box, Container, Typography } from "@material-ui/core";
import CTAButton from "../components/CTAButton";
import { Link as RouterLink } from "react-router-dom";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  background: {
    backgroundImage: "url('https://images.unsplash.com/photo-1579546929518-9e396f3cc809?ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80')",
    backgroundSize: "cover",
    backgroundPosition: "center",
    backgroundRepeat: "no-repeat",
    minHeight: "100vh",
    position: "relative",
    "&::before": {
      content: '""',
      position: "absolute",
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundColor: "rgba(0, 0, 0, 0.5)",
    }
  },
  content: {
    position: "relative",
    zIndex: 1,
    color: "white",
  }
}));

export function Welcome(): JSX.Element {
  const classes = useStyles();

  return (
    <Box className={classes.background}>
      <Container className={classes.content}>
        <Box
          height="100vh"
          display="flex"
          flexDirection="column"
          justifyContent="center"
          alignItems="center"
        >
          <Box width={1}>
            <Typography variant="h1">Students emotion detector</Typography>
          </Box>
          <Box mt={4} width={1} display="flex" alignItems="center">
            <Box>
              <CTAButton component={RouterLink} to="/login">
                Start
              </CTAButton>
            </Box>
          </Box>
        </Box>
      </Container>
    </Box>
  );
}
